import { createSlice } from "@reduxjs/toolkit";

const etc = createSlice({
    name: "etc", //state 이름
    initialState: {
        CheckList: [],
    },
    reducers:{
        CheckList: (state, action) => {
            state.CheckList = action.payload;
        },
    }
});

export const {
    CheckList, 
} = etc.actions;
export default etc;
